create table cases (
	id INT UNIQUE,
	victim_first VARCHAR(50),
	victim_last VARCHAR(50),
	victim_gender VARCHAR(50),
	victim_race VARCHAR(50),
	victim_dob DATE,
	city VARCHAR(50),
	state VARCHAR(50),
	lat VARCHAR(255),
	longtd VARCHAR(255),
	zip VARCHAR(50),
	cause VARCHAR(22),
	offense VARCHAR(21),
	year VARCHAR(50)
);
